import React, { useState } from 'react';

function App() {
  const [currentStep, setCurrentStep] = useState(1);
  const totalSteps = 7;

  // Form data state
  const [formData, setFormData] = useState({
    // Personal Information
    fullName: '',
    dateOfBirth: '',
    gender: '',
    identificationNumber: '',

    // Contact Information
    phoneNumber: '',
    email: '',
    address: '',

    // Emergency Contact
    emergencyName: '',
    emergencyPhone: '',
    emergencyRelation: '',

    // Program
    preferredProgram: '',
    joiningDate: '',

    // Accommodation
    requiresAccommodation: false,
    checkInDate: '',

    // Airport Pickup
    requiresPickup: false,
    arrivalDate: '',
    arrivalTime: '',

    // Additional
    photo: null
  });

  const handleInputChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const renderStepContent = () => {
    switch(currentStep) {
      case 1:
        return (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Full Name
              </label>
              <input 
                type="text"
                name="fullName"
                value={formData.fullName}
                onChange={handleInputChange}
                placeholder="Enter your full name"
                className="w-full px-4 py-3 bg-white border-2 border-[#1B3168]/20 rounded-xl 
                         text-[#1B3168] placeholder-[#1B3168]/50
                         focus:outline-none focus:border-[#4CAF50] focus:ring-1 focus:ring-[#4CAF50]
                         transition-all duration-300"
              />
            </div>
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Date of Birth
              </label>
              <input 
                type="date"
                name="dateOfBirth"
                value={formData.dateOfBirth}
                onChange={handleInputChange}
                className="w-full px-4 py-3 bg-white border-2 border-[#1B3168]/20 rounded-xl"
              />
            </div>
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Gender
              </label>
              <select 
                name="gender"
                value={formData.gender}
                onChange={handleInputChange}
                className="w-full px-4 py-3 bg-white border-2 border-[#1B3168]/20 rounded-xl"
              >
                <option value="">Select Gender</option>
                <option value="male">Male</option>
                <option value="female">Female</option>
                <option value="other">Other</option>
              </select>
            </div>
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                ID/Passport Number
              </label>
              <input 
                type="text"
                name="identificationNumber"
                value={formData.identificationNumber}
                onChange={handleInputChange}
                placeholder="Enter ID/Passport number"
                className="w-full px-4 py-3 bg-white border-2 border-[#1B3168]/20 rounded-xl"
              />
            </div>
          </div>
        );

      case 2:
        return (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Phone Number
              </label>
              <input 
                type="tel"
                name="phoneNumber"
                value={formData.phoneNumber}
                onChange={handleInputChange}
                placeholder="Enter phone number"
                className="w-full px-4 py-3 bg-white border-2 border-[#1B3168]/20 rounded-xl"
              />
            </div>
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Email Address
              </label>
              <input 
                type="email"
                name="email"
                value={formData.email}
                onChange={handleInputChange}
                placeholder="Enter email address"
                className="w-full px-4 py-3 bg-white border-2 border-[#1B3168]/20 rounded-xl"
              />
            </div>
            <div className="md:col-span-2 space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Address
              </label>
              <textarea 
                name="address"
                value={formData.address}
                onChange={handleInputChange}
                placeholder="Enter your address"
                className="w-full px-4 py-3 bg-white border-2 border-[#1B3168]/20 rounded-xl"
                rows={3}
              />
            </div>
          </div>
        );

      case 3:
        return (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Emergency Contact Name
              </label>
              <input 
                type="text"
                name="emergencyName"
                value={formData.emergencyName}
                onChange={handleInputChange}
                placeholder="Emergency contact name"
                className="w-full px-4 py-3 bg-white border-2 border-[#1B3168]/20 rounded-xl"
              />
            </div>
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Emergency Contact Phone
              </label>
              <input 
                type="tel"
                name="emergencyPhone"
                value={formData.emergencyPhone}
                onChange={handleInputChange}
                placeholder="Emergency contact phone"
                className="w-full px-4 py-3 bg-white border-2 border-[#1B3168]/20 rounded-xl"
              />
            </div>
            <div className="space-y-2">
              <label className="block text-[#1B3168] text-sm font-medium">
                Relationship
              </label>
              <input 
                type="text"
                name="emergencyRelation"
                value={formData.emergencyRelation}
                onChange={handleInputChange}
                placeholder="Relationship to emergency contact"
                className="w-full px-4 py-3 bg-white border-2 border-[#1B3168]/20 rounded-xl"
              />
            </div>
          </div>
        );

      // Add more cases for remaining steps...
      default:
        return null;
    }
  };

  const getStepTitle = () => {
    switch(currentStep) {
      case 1: return "Personal Information";
      case 2: return "Contact Information";
      case 3: return "Emergency Contact";
      case 4: return "Program Enrollment";
      case 5: return "Accommodation";
      case 6: return "Airport Pickup";
      case 7: return "Additional Information";
      default: return "";
    }
  };

  const handleContinue = () => {
    if (currentStep < totalSteps) {
      setCurrentStep(currentStep + 1);
    } else {
      // Handle form submission
      console.log('Form submitted:', formData);
    }
  };

  return (
    <div className="min-h-screen w-full flex items-center justify-center bg-[#1B3168] p-4">
      <div className="absolute top-4 left-4 md:left-8">
        <img src="/logo.png" alt="Huduma Center Logo" className="h-16 md:h-20" />
      </div>

      <div className="relative w-full max-w-4xl mx-auto mt-20">
        <div className="bg-white/95 rounded-2xl shadow-2xl overflow-hidden">
          <div className="p-8 bg-[#1B3168] border-b">
            <h1 className="text-3xl md:text-4xl font-bold text-white text-center mb-2">
              {getStepTitle()}
            </h1>
            <p className="text-[#4CAF50] text-center font-medium">
              Step {currentStep} of {totalSteps}
            </p>
          </div>

          <div className="p-6 md:p-8 space-y-6">
            {renderStepContent()}

            <div className="flex justify-between pt-6">
              {currentStep > 1 && (
                <button 
                  onClick={() => setCurrentStep(currentStep - 1)}
                  className="px-6 py-3 bg-gray-100 hover:bg-gray-200 
                           text-[#1B3168] font-semibold rounded-xl
                           transition-all duration-300"
                >
                  Previous
                </button>
              )}
              <button 
                onClick={handleContinue}
                className={`px-8 py-3 bg-[#4CAF50] hover:bg-[#45a049] 
                         text-white font-semibold rounded-xl
                         transition-all duration-300 
                         ${currentStep === 1 ? 'ml-auto' : ''}`}
              >
                {currentStep === totalSteps ? 'Submit' : 'Continue'}
              </button>
            </div>
          </div>

          <div className="bg-[#4CAF50] p-4 text-white text-center">
            <p className="font-medium">Contact Us</p>
            <p className="text-sm">info@hudumacenter.com | 206-460-9022</p>
            <p className="text-sm">30821 Pacific Hwy S, Federal Way, WA 98003</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
